import { Redirect } from "react-router-dom";
import Cookies from "js-cookie";

const Cart = () => {
  const jwtToken = Cookies.get("token");
  if (jwtToken === undefined) {
    <Redirect to="/login" />;
  }
  return (
    <div>
      <img
        src="https://assets.ccbp.in/frontend/react-js/nxt-trendz-cart-img.png"
        alt="cart"
      />
    </div>
  );
};

export default Cart;
